import React from "react";
import BackgroudImage from "../Images/BackgroundImage.jpeg";
import {Container,Row,Col} from 'react-bootstrap'

function BackgroounfImage() {
  return (
    <div>
      <Container>
        <Row>
          <Col className="BackgroundHeading">
          <h1>Get Mehndi Artist</h1>
           <h1>for your wedding Day</h1>
           </Col>
          <Col><img className="bgImage" src={BackgroudImage} alt="BackgroundImage" /></Col>
        </Row>
      </Container>
    </div>
  );
}

export default BackgroounfImage;
